    data: |
      SELECT + col2 AS col1 FROM tab0 (FORMAT parquet) WHERE ( + col2 * + col0 + - ( 80 ) + col0 * + col1 ) IS NOT NULL;
  - name: tab0

outputs:
  - name: q10681.out
    data: |
      10
      47
      99
